import React, { Component } from 'react'
import { Link } from 'react-router-dom';

export default class LeftNav extends Component {
  render() {
    return (
      <div className="LeftNav_Card">
          <ul className='leftNav'>
              <Link to="/#">
              <li>  <i class="material-icons">person</i> Posts </li> </Link>
              <Link to="/#">
              <li>  <i class="material-icons">collections</i> Galleries </li> </Link>
              <Link to="/#">
              <li>  <i class="material-icons">fastfood</i> Recipies </li> </Link>
              <Link to="/#">
              <li>  <i class="material-icons">device_hub</i> Family Tree </li> </Link>
          </ul>
      </div>
    )
  }
}
